public static void initTables(int k, int rows, byte[] codingMatrix,
                              int matrixOffset, byte[] gfTables) {
  int i, j;

  int offset = 0, idx = matrixOffset;
  for (i = 0; i < rows; i++) {
    for (j = 0; j < k; j++) {
      GF256.gfVectMulInit(codingMatrix[idx++], gfTables, offset);
      offset += 32;
    }
  }
}
